import { Card, CardContent } from "@mui/material";
import "./styles.css";

function Shell({ heading, content }) {
  return (
    <Card variant="outlined">
      <CardContent>
        <h1>{heading}</h1>
      </CardContent>
      {content}
    </Card>
  );
}

export default Shell;
